import React from "react"
import PropTypes from "prop-types"
import { StyledGrid, StyledGridContent } from "./StyledGrid"
const Grid = ({ header, children }) =>(
    <StyledGrid>
        <h1>{header}</h1>
        <StyledGridContent>{children}</StyledGridContent>
    </StyledGrid>
)
Grid.propTypes = {
    header: PropTypes.string,
}
export default Grid
